Conor is the orphaned heir of one of the many tribal leaders of hopelessly divided Hibernia (ancient Ireland). With his faithful but unenthusiastic servant and protector Fergus, he wanders through the island, fighting injustice and aspiring to unite the druidic, yet internecine Celts in order to free the country from Roman rule. Most dangers and opponents he faces are largely or completely mythical, the most remarkable being Longinus, the eternally cursed but immortal, cruel and vindictive Roman centurion at Christ's crucifixion who forges evil alliances.

